import React from 'react'
import UserInfo from '../components/UserInfo';
import styled from 'styled-components'
import RegisterDirect from 'user/components/RegisterDirect';

const Login = () => (
<div class="login">
    <h1>로그인</h1>
    <form style={{width:"100%"}}>
                        
                <label class="user_id" title="user_id">                
                <input id="user_id" name="user_id" fw-filter="isFill" fw-label="아이디" fw-msg class="inputTypeText" placeholder="아이디" type="text"/>
                </label><br/><br/>
                <label class="user_pw" title="user_pw">
                <input id="user_pw" name="user_pw" fw-filter="iSFill" fw-label="패스워드" fw-msg autocomplete="off" placeholder="비밀번호" type="password"/></label><br/><br/>
                {/* separate instance where input is wrong */}
                {/* <Wrong/> */}
                
                <br/><input type="submit" title="로그인" value="로그인" /> <br/><input type="button" title="ID/PW 찾기" value="ID/PW 찾기" /><br/>            
    </form><br/>

    {/* <a href={RegisterDirect} target="_blank" onclick={window.open(RegisterDirect)}> */}
    <input type="submit" title="회원 가입" value="회원 가입" /> <input type="submit" title="인증서 가입" value="인증서 가입"/><br/><br/>
    <input type="button" title="인증서 로그인" value="인증서 로그인" /><br/><br/>
    <input type="button" title="SNS 로그인" value="네이버 로그인" /><br/><br/>
    <input type="button" title="SNS 로그인" value="카카오 로그인" /><br/><br/>
    
</div>

)
export default Login;

